import styled from "styled-components"

const Container = styled.div`
    width:100vw;
    height:100vh;
    background: linear-gradient(rgba(255,255,255,0.5),rgba(255,255,255,0.5)), url("https://cdn.pixabay.com/photo/2022/01/30/12/39/mountains-6980701_960_720.jpg") center;
    align-items:center;
    justify-content:center;
    display:flex;
`;

const Wrapper = styled.div``;

const Title = styled.div``;

const Form = styled.form``;

const Input = styled.input``;

const Agreement = styled.span``;

const Button = styled.button``;


export const Register = () => {
  return (
    <Container>
        <Wrapper>
            <Title>CREATE AN ACCOUNT</Title>
            <Form>
            <Input placeholder="name" />
            <Input placeholder="lastname" />
            <Input placeholder="username" />
            <Input placeholder="email" />
            <Input placeholder="password" />
            <Input placeholder="confirm password" />
            <Agreement>
                By creating an account you are agreeing to terms and conditions.
            </Agreement>
            <Button>Create</Button>
            </Form>
        </Wrapper>
    </Container>
  )
}
